<p class="bold m-0 p-0">The applicant's claims</p>
<p class="m-0 p-0">The applicant has applied for the grant of a Visitor visa (subclass 600) to visit Australia for a temporary stay.</p>
<br>
<p class="bold m-0 p-0">Information and evidence considered</p>
<p class="m-0 p-0">I am a delegated decision maker under section 65 of the Migration Act 1958. In reaching my decision, I have considered the following:</p>
<ul>
    <li>relevant legislation contained in the Migration Act and Migration Regulations 1994</li>
    <li>information contained in the Department's Procedural Instructions</li>
    <li>documents and information provided by the applicant(s)</li>
    <li>relevant information held on Departmental files.</li>
</ul>
<p class="bold m-0 p-0">Findings</p>
<p class="m-0 p-0">On the basis of all the information available to me, including the documents and information the applicant provided, I find that the criteria for the grant of a Visitor (Tourist) visa in the Tourist stream are not satisfied.</p>
<br>
<p class="bold m-0 p-0">Reasons</p>
<p class="m-0 p-0">I have assessed the application and the reasons for my decision are detailed below.</p>
<p>An application for a Visitor (Tourist) visa in the Tourist stream has been made by the applicant.</p>
<hr />
<p style="text-align:center; m-0" class="m-0">
    Department of Home Affairs
</p>
<p style="text-align:center;" class="m-0">
    <b>WEBSITE:</b> www.homeaffairs.gov.au
</p>
<div style="page-break-before:always"></div>
<p>A visa cannot be granted unless the relevant criteria specified in the Migration Act and the Migration Regulations are satisfied.</p>
<p>In this case, I am not satisfied that clause 600.211 in Schedule 2 of the Migration Regulations is satisfied. This clause provides that:</p>
<p class="bold m-0 p-0">600.211</p>
<p>The applicant genuinely intends to stay temporarily in Australia for the purpose for which the visa is granted, having regard to:</p>
<ol type="a">
    <li>whether the applicant has complied substantially with the conditions to which the last substantive visa, or any subsequent bridging visa, held by the applicant was subject; and</li>
    <li>whether the applicant intends to comply with the conditions to which the Subclass 600 visa would be subject; and</li>
    <li>any other relevant matter.</li>
</ol>
<p>In assessing whether or not the applicant genuinely intends to stay temporarily in Australia, I have taken into account information provided in the application, the applicant's immigration history and compliance with previous visas. I have also taken into consideration any supporting documents as well as the applicant's personal circumstances, commitments, and incentive to return to their country of residence.</p>
<p class="bold m-0 p-0">My decision is based on the following factors</p>
<p>The applicant claims that their purpose for travelling to Australia is for tourism</p>
<p>I have assessed the application based on the documentation and evidence provided by the applicant. The applicant is an Indian national, residing in India. The applicant intends to travel alone. Before a visa can be issued, applicants must demonstrate strong financial, employment and/or personal ties which would demonstrate their incentive to abide by the conditions of that visa and depart Australia at the end of their authorised temporary stay.</p>
<p>The applicant has claimed to be employed at GS Agro Foods. I have considered the circumstances of the applicant and find that their claimed employment and income cannot be considered significant in the context of the current economic and employment conditions in India. As such, I do not consider it a strong incentive for them to abide by the conditions of the visa or to stay temporarily in Australia and return to India </p>
<p>After considering the information provided, I am not satisfied that the applicant genuinely intends to stay temporarily in Australia for the purposes set out above</p>
<p>Therefore, I am not satisfied that the applicant meets the relevant criteria in clause 600.211 in Schedule 2 of the Migration Regulations.</p>
<p class="bold m-0 p-0">Decision</p>
<p class="m-0 p-0">As clause 600.211 is not satisfied, I find the criteria for the grant of a Visitor (Tourist) visa in the Tourist stream are not satisfied. Therefore, I refuse the application by the applicant for a Visitor (Tourist) visa in the Tourist stream.</p>
